import styled from 'styled-components';


export const Searchbar = styled.input`

     display:flex;
     justify-content:center;



    .dv {
     padding-top: 3em;
     height: 10em;

  }

    .Sc {
     display:flex;
     justify-content:center; 
     margin-top:auto;
     margin-bottom: auto;
 }

   .inpt {
    outline: 0;
    border: 0;
    background: none;
    width: 0;
    height: 2.8em;
    caret-color:transparent;
    font-family: 'Gloria Hallelujah', cursive;
    transition: width 0.5s linear;
 }   

   .search_icon {
    color: red;

    `;
